import React from "react";
import Cardlist from "./Cardlist";

const Card = (props) => {
    return(
        <>
            <div className="main_div">
        <h1> Color Picker </h1>
        <div className="content">
          <Cardlist />
        </div>
        </div>
        </>
    )
}

export default Card;
